// Profile.jsx

import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Profile = () => {
  const [orders, setOrders] = useState([]);
  const [accountDetails, setAccountDetails] = useState({});

  useEffect(() => {
    // Получаем информацию о заказах
    const fetchOrders = async () => {
      try {
        const response = await axios.get('http://localhost:5000/orders'); // Замените на ваш эндпоинт
        setOrders(response.data);
      } catch (error) {
        console.error('Error fetching orders:', error);
      }
    };

    // Получаем информацию об аккаунте пользователя
    const fetchAccountDetails = async () => {
      try {
        const response = await axios.get('http://localhost:5000/users/account'); // Замените на ваш эндпоинт
        setAccountDetails(response.data);
      } catch (error) {
        console.error('Error fetching account details:', error);
      }
    };

    fetchOrders();
    fetchAccountDetails();
  }, []);

  return (
    <div>
      {/* Часть для отображения заказов */}
      <div className="orders-section">
        <h4>Orders</h4>
        <div className="table_page table-responsive">
          <table>
            <thead>
              <tr>
                <th>Order</th>
                <th>Date</th>
                <th>Status</th>
                <th>Total</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {orders.map((order) => (
                <tr key={order.orderNum}>
                  <td>{order.orderNum}</td>
                  <td>{order.date}</td>
                  <td>
                    <span className="success">{order.status}</span>
                  </td>
                  <td>{order.total}</td>
                  <td>
                    <a href={`cart.html?orderNum=${order.orderNum}`} className="view">
                      view
                    </a>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>

      {/* Часть для отображения данных аккаунта */}
      <div className="account-details-section">
        <h3>Account details</h3>
        <div className="login">
          <div className="login_form_container">
            <div className="account_login_form">
              <form action="#">
                <div className="default-form-box mb-20">
                  <label>First Name</label>
                  <input type="text" name="first-name" value={accountDetails.firstName} readOnly />
                </div>
                <div className="default-form-box mb-20">
                  <label>Last Name</label>
                  <input type="text" name="last-name" value={accountDetails.lastName} readOnly />
                </div>
                <div className="default-form-box mb-20">
                  <label>Email</label>
                  <input type="text" name="email-name" value={accountDetails.email} readOnly />
                </div>
                {/* Другие поля для отображения данных аккаунта */}
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Profile;
